function TableRow2({log}) {
  return (
    <tr>
      <td>{log.name}</td>
      <td>{log.car}</td>
      <td>{log.lcv}</td>
      <td>{log.truck}</td>
      <td>{log.heavy}</td>
    </tr>
  )
}

export default TableRow2
